import React from 'react';
import ReactDOM from 'react-dom';

class ExamChecker extends React.Component
{
  constructor(props)
  {
    super(props);
    this.state =
    {
      score: 30
    }
  }
  render(){
    return <div>Checker({this.state.score})</div>
  }
}
let Checker = (props) => {
  if(props.score<30){
    return <h1>you've faild!</h1>
  }
  else if(props.score>30){
    return <h1>you've passed!</h1>
  }
}
ReactDOM.render(
          <Checker/>,
          document.getElementById('root')
          );
